import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import './NavBer.css'
import {Route,Link,Switch,BrowserRouter as Router} from  '../../node_modules/react-router-dom'

import logo from '../images/logo.png'




class NavBer extends Component {
    render() {
        return (
          <div>
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="./home" style={{color:"whitesmoke"}}>COVIT-19 SURVEY FORM</Navbar.Brand>
    <Nav className="NavLink">      
      <Nav.Link href="#home"style={{color:"white"}}>Home</Nav.Link>
      <Nav.Link href="/survey"style={{color:"white"}}>Survey</Nav.Link>
      <Nav.Link href="/stats"style={{color:"white"}}>COVIT-19 Live Stats</Nav.Link>
      <Nav.Link href="#about"style={{color:"white"}}>About Us</Nav.Link> 
    </Nav>   
  </Navbar>

          </div>
        );
    }
}

export default NavBer;
